<template>
	<view class="content_tab4">
		<view class="text-area">
			<exam-widght 
			        :dataList='questionList' 
			        :index="index" 
			        @select='selectItem' 
			        @selectFinish='selectFinish' 
			        @finish='finish'
			        :numBoxType='0'
			        :showIndexText='showIndexText'
			        :numBoxShow='numBoxShow'
					ref="exam"
			        >
			</exam-widght>
		</view>
	</view>
</template>

<script>
	
	import examWidght from '@/components/Li-ExamWidght/Li-ExamWidght.vue';
	import question from '@/mixins/question.js'
	
	export default {
		components: {examWidght},
		mixins: [ question ],
		data(){
			return {
				questionList: []
			}
		},
		onLoad() {
			this.questionList = this.getArrItem(this.QuestionList, 10)
			uni.$on('pullQuestion', () => {
				this.questionList = this.getArrItem(this.QuestionList, 10);
				this.$refs.exam.currentSelectFinish(0);	
			})
		},
		methods: {
			  getArrItem(arr, num) {
				  var temp_array = new Array();
				  for (var index in arr) {
					  temp_array.push(arr[index]);
				  }
				  var return_array = new Array();
				  for (var i = 0; i < num; i++) {
					  if (temp_array.length > 0) {
						  var arrIndex = Math.floor(Math.random() * temp_array.length);
						  return_array[i] = temp_array[arrIndex];
						  temp_array.splice(arrIndex, 1);
					  } else {
						  break;
					  }
				  }
				  return return_array;
			  },
			selectItem(val){
				console.log(val)
			},
			selectFinish(val){
				console.log(val)
			},
			async finish(val){
				const _this = this;
				const { questions = [] } = val;
				if(Array.isArray(questions) && questions.length > 0){
					questions.forEach(el => {
						if(!el.fldAnswer){
							_this.$showToast({ title: '还有未完成的题目哟' })
							return
						}
					})
					if(questions.every(e => e.fldAnswer)){
						const { confirm } = await _this.$showModal({
							title: '提示',
							content: '确定要提交吗？',
							confirmColor: '#C00000'
						});
						if(confirm){
							uni.navigateTo({
								url: `/pageTab4/detail?answer=${encodeURIComponent(JSON.stringify(questions))}`
							})
							return
						}
					}
				}
			}
		}
	}
</script>

<style lang="scss">
.content_tab4{
	box-sizing: border-box;
	width: 100%;
	padding: 20rpx;
background: url(data:image/png;base64,) no-repeat center center;
		background-size: 100% 100%;
		height: calc(100vh);
		overflow-y: scroll;
	.text-area{
		width: 100%;
		box-sizing: border-box;
		background: #FFFFFF;
		padding: 15rpx;
		border-radius: 15rpx;
		box-shadow:0px 0px 20rpx 0px rgba(0,0,0,0.08);
		line-height: 50rpx;	
		font-size: 26rpx;
		min-height: 100%;
	}
}
</style>
